import React, { Component } from "react";
import "./Landing.css";
import Menu from "../Menu_Bar/menu";
import Footer from "./footer/Footer";

class Landing extends Component {
  render() {
    return (
      <div>
      <div id="main">
        
        <div id="container">
        
          <div id="header">
            
            <div id="logo">
              <img src= {require('./Logo.png')} alt="N/A"/>
            </div>
            <Menu/>
            
          </div>
          
        </div>
        <Footer/>
      </div>
      </div>
    );
  }
}

export default Landing;
